import React from "react";
import './nav.css';
import {FaHome, FaUser, FaCode, FaBriefcase, FaPhone} from 'react-icons/fa';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function Nav () {
    return (
        <nav>
            <ul>
                <li><a href="#"  className = "home-fa"><FontAwesomeIcon icon={"fa-regular fa-phone flip"}/><span>Home</span></a></li>
                <li><a href="#"  className = "about-fa"><FaUser/><span>About</span></a></li>
                <li><a href="#"  className = "skills-fa"><FaCode/><span>Skills</span></a></li>
                <li><a href="#"  className = "projects-fa"><FaBriefcase/><span>Projects</span></a></li>
                <li><a href="#"  className = "contact-fa"><FaPhone/><span>Contact</span></a></li>
            </ul>
        </nav>
    );
}

export default Nav;
